import * as React from 'react';
import './style.css'
import {Routes, Route, Link} from 'react-router-dom'


export interface IHeaderProps {
}

export default class Header extends React.Component<IHeaderProps> {
  public render() {
    return (
      <div>
        <header>
          <div className='navBar'>
              <Link className='link' to='/'><div className='navItem'> <i/>Home <i/></div></Link>
              <Link className='link' to='/users'><div className='navItem'> <i/>Usuarios<i/></div></Link>
          </div>
        </header>
      </div>
    );
  }
}
